import * as React from 'react';
import { Box, Typography, Divider, Container } from '@mui/material';

function Education() {
  return (
    <Box sx={{ pb: 8, bgcolor: '#e3f2fd', width: '100%' }}>
      {/* Heading */}
      <Typography
        variant="h3"
        align="center"
        sx={{
          fontWeight: '600',
          color: '#2c3e50',
          mb: 6,
          fontFamily: 'Poppins, sans-serif',
          textTransform: 'uppercase',
          letterSpacing: 2,
        }}
      >
        Education
      </Typography>

      <Container maxWidth="md">
        {/* Education Item */}
        <Box
          sx={{
            bgcolor: '#fff',
            p: 4,
            borderRadius: 4,
            boxShadow: 3,
            textAlign: 'center',
            mb: 4,
          }}
        >
          <Typography
            variant="h5"
            sx={{
              fontWeight: '600',
              color: '#1e88e5',
              fontSize: '1.5rem',
              marginBottom: 1.5,
            }}
          >
            Comsats University Islamabad, Abbottabad Campus
          </Typography>
          <Typography
            variant="body1"
            sx={{
              fontWeight: '500',
              color: '#333',
              fontSize: '1.2rem',
              marginBottom: 1,
            }}
          >
            Bachelor of Science in Computer Science
          </Typography>
          <Typography
            variant="body2"
            sx={{
              color: '#555',
              fontSize: '1rem',
              marginBottom: 3,
            }}
          >
            September 2020 - September 2024
          </Typography>
          <Divider sx={{ mb: 3, borderColor: '#ddd', width: '80%', mx: 'auto' }} />
          <Typography
            variant="body2"
            sx={{
              color: '#555',
              fontSize: '1rem',
            }}
          >
            Relevant Coursework: Data Structures, Algorithms, Web Development, Machine Learning, OOP, Mobile Application Development
          </Typography>
        </Box>
      </Container>
    </Box>
  );
}

export default Education;
